import React from 'react';
import Header from './Components/Header'
import Balance from './Components/Balance'
import IncomeExpenses from './Components/Balance'

import './App.css'

const App = () => {
  return (
    <div>
      <Header />
      <div className="container">
        <Balance />
        <IncomeExpenses />
      </div>
    </div>
  );
};

export default App;
